package variablesAndDatatypes;

public class ElseStatment {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		int a=10;
		int b=20;
		a=b;
		
		if(a>b)
		{
			System.out.println("Execute 1st statment");
		}
		else if(a<b)
		{
			System.out.println("Execute 2nd statment");
		}else
		{
			System.out.println("Execute 3rd statment");
		}

	}

}
